const Hello = (props) => (
  <div>
    <p>Hello {props.name}</p>
  </div>
)

const App = () => (
  <div>
    <h1>Greetings</h1>
    <Hello name="George" />
    <Hello name="Daisy" />
  </div>
)

export default App
